  \"[\"Monthly mean sea level (MSL) variations were analyzed for 128 stations of the
  National Ocean Service's (NOS) National Water Level Observation Network (NWLON)
  having between 30 and 146 years of data to obtain the linear trend, the average
  seasonal cycle, and the interannual variations. Recorded water levels are a combination
  of changes in the sea level and the vertical land motion at the location of the
  gauge. Therefore, the trends derived are relative MSL trends and can be considered
  valid only for a region near the gauge with uniform vertical land motion. Calculation
  of absolute MSL trends requires the accurate determination of vertical land motion
  at the gauges and was beyond the scope of this project.\"]\"\n\t},\n\t{\n\t\t\"key\":
